import logo from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';

function App() {
  return (
    <div className="App">
      <Card sx={{ minWidth: 275 }}>
        Card
      </Card>
      <Button variant="contained">
        Sign In
      </Button>
    </div>
  );
}

export default App;
